import React from "react";

const Movies = (props) => {
  const { data, count } = props;

  return (
    <div>
      <ul>
        <p>{count}</p>
        <Container>
          <Row>
            {data.map((movie) => {
              return (
                <Col xs={6} md={4}>
                  <Image src="holder.js/171x180" rounded />
                  <li className="movie" key={movie.id}>
                    {movie.title}
                  </li>
                </Col>
              );
            })}
          </Row>
        </Container>
      </ul>
    </div>
  );
};

export default Movies;
